exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`https://www.danmei.la/book/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,[/<div class="mulu">\s*<ul>(?<fragment>(?:\s*<li>\s*<a[^>]*>[^<]*<\/a>\s*<\/li>)*)/,/<a href="(?<url>[^"]+)"[^>]*>(?<name>[^<]+)</g],{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"}})};